import './estilos.css'
import bb8 from "../../../assests/bb8.png"


export default function List({value,item}) {
    return (
        <div class="container">

          <text class="textUser" > {value} </text>
          <img  src={bb8}  title="bb8" alt="amiguinho" /> 
          <text>{item} </text>
        </div>
    );
}
